  "call_control.inbound_routes.did_option_detail": "Укажите шаблон DID для сопоставления и передачи входящего вызова через этот входящий маршрут. Возможные варианты:\n · Шаблоны DID: добавить один или несколько шаблонов DID. Вызовы, соответствующие заданному DID, будут направлены в заданное место назначения. Оставьте это поле пустым, чтобы сопоставлять входящие вызовы с любой информацией DID или без нее.\n · Сопоставление шаблона DID с расширениями: используйте подстановочный знак {{.Ext}} для сопоставления внутреннего номера в шаблоне DID. Если выбран этот параметр, вам нужно будет настроить пункт назначения для этого входящего маршрута как  Сопоставить выбранные расширения  и выбрать расширения, которым разрешено сопоставление. Например. если шаблон DID - 550 {{. Ext}}, а разрешенный внутренний номер - 1000, то вызовы, поступающие с DID 5501000, будут перенаправлены на добавочный номер 1000, а вызовы, поступающие с 5502000, не будут соответствовать этому правилу.\n · Match DID Range to Extension Range: соответствие DID Range и Extension Range во взаимно однозначном соответствии. Если выбран этот параметр, вам необходимо настроить пункт назначения для этого входящего маршрута как  Сопоставить диапазон DID с диапазоном расширений  и настроить DID и диапазон расширений. Например. если диапазон DID - 5503301-5503305, а диапазон расширений - 1001-1005, то вызовы, поступающие с DID 5503301, будут перенаправлены на 1001, а вызовы, поступающие с 5503302, будут маршрутизированы на 1002.\n \n В шаблонах DID, следующие символы имеют особое значение:\n · X соответствует числам 0-9;\n · Z соответствует числам 1-9;\n · N соответствует числам 2-9;\n · [12345- 9] соответствует числам в скобках (в этом примере 1, 2, 3, 4, 5, 6, 7, 8, 9);\n · Подстановочный знак \".\" соответствует одному или нескольким числам. Например. \"9011.\" соответствует всему, что начинается с 9011 (кроме самого 9011);\n · Подстановочный знак \"!\" не соответствует ни одному или более чем одному числу. Например. \"9011!\" соответствует всему, что начинается с 9011 (включая сам 9011);ому числу. Например. \"9011!\" соответствует всему, что начинается с 9011 (включая сам 9011);",
