  "call_control.inbound_routes.time_condition_detail": "Выберите способ маршрутизации входящих вызовов по дате и времени. Возможны следующие варианты: <br /> · На основе глобального рабочего времени: маршрутизация входящих вызовов на основе рабочих часов и праздников, определенных в <b> Управление вызовами> Рабочие часы и праздничные дни </b>. Вы сможете настроить отдельные пункты назначения маршрутизации для рабочих часов, вне рабочих часов и в праздничные дни. <br /> · На основе настраиваемых рабочих часов: настройте эксклюзивное правило рабочих часов для этого маршрута и настройте отдельные направления маршрутизации для рабочих часов вне рабочего времени. Рабочие часы и праздничные дни. <br /> · На основе настраиваемых периодов времени: установите несколько периодов времени с отдельными направлениями маршрутизации. Помимо настраиваемой временной маршрутизации, вы также сможете настроить пункт назначения в праздничные дни для этого входящего маршрута. Вне установленных периодов времени и праздников входящие вызовы будут направляться в пункт назначения по умолчанию.",
