  "call_control.office_time_and_holidays.type_detail": "Установите тип праздника. Возможные варианты: <br /> · По дате: выберите конкретную дату, и выходной день будет выполнен только один раз. <br /> · По месяцу: выберите определенный месяц + день, и выходной день будет выполняться каждый год. <Br > · По неделям: выберите определенный месяц + определенный день определенной недели, и выходной день будет выполняться каждый год. <br /> Примечание: при выборе «По дате» и «По месяцу» дата начала и дата окончания могут быть одинаковыми. день, указывающий на конкретный день.",
