  "call_control.outbound_routes.available_time_detail": "Выберите временные условия, чтобы разрешить этот исходящий маршрут. Возможны следующие варианты: <br /> · Всегда: в любое время разрешенные добавочные номера могут совершать исходящие вызовы через этот исходящий маршрут. <br /> · На основе глобальных рабочих часов: управлять маршрутом на основе рабочих часов и праздников, определенных в <b > Управление звонками> Часы работы и праздничные дни </b>. Вы можете настроить, следует ли разрешить этот маршрут в рабочее время, вне рабочего времени и в праздничные дни отдельно. <br /> · На основе настраиваемого рабочего времени: установите эксклюзивное правило рабочего времени для этого маршрута и управляйте соответствующим образом. Вы можете настроить, разрешать ли этот маршрут в рабочее время, вне рабочего времени и в праздничные дни отдельно. <br /> · На основе настраиваемых периодов времени: настройте несколько периодов времени, чтобы разрешить этот маршрут. Вы также можете указать, разрешать ли этот маршрут в праздничные дни.",
  "call_control.outbound_routes.available_time_err": "Этот исходящий маршрут будет недоступен в любое время. Вы уверены, что сохраните настройки?",
