  "call_control.outbound_routes.dial_patterns": "Настройки согласования набора",
  "call_control.outbound_routes.dial_patterns_detail": "Исходящие вызовы, соответствующие этому шаблону набора, будут использовать этот исходящий маршрут. <br /> <br /> В шаблонах следующие символы имеют особое значение: <br /> · X соответствует числам 0-9; <br /> · Z соответствует числам 1-9; <br /> · N соответствует числам 2- 9; <br /> · [12345-9] соответствует числам в скобках (в этом примере 1, 2, 3, 4, 5, 6, 7, 8, 9); <br /> · Подстановочный знак \".\" соответствует одному или нескольким числам. Например. \"9011.\" соответствует всему, что начинается с 9011 (кроме самого 9011); <br /> · Подстановочный знак \"!\" для расширений SIP не соответствует ни одному или нескольким символам. Например. \"9011!\" соответствует любым добавочным номерам SIP, начинающимся с 9011 (включая сам 9011); Для внутренних номеров FXS он используется для набора номера с перекрытием. АТС выполнит дозвон после набора номера и при однозначном совпадении. Например, при вводе «9011!», Когда внутренние абоненты FXS набирают 9011, УАТС немедленно набирает номер. <br /> <br /> Полоса: полоса позволяет вам указать количество цифр, которые будут удалены из передней части номера телефона перед звонок размещен. Например, если вы должны нажать 0 перед набором номера телефона, одна цифра должна быть удалена из строки набора перед выполнением вызова. <br /> <br /> Prepend: эти цифры будут добавлены к номеру телефона перед вызовом размещен. Например, если внешняя линия требует набора из 10 цифр, но пользователям удобнее набирать из 7 цифр, это поле можно использовать для добавления 3-значного кода зоны ко всем 7-значным телефонным номерам перед выполнением вызовов.",
