  "call_features.feature_codes.lunch_break": "Перерыв на обед",
  "call_features.feature_codes.lunch_break_detail": "Если этот параметр включен, добавочные номера могут набирать код функции + номер внутреннего абонента, чтобы изменить статус присутствия внутреннего абонента на «Перерыв на обед». Только набор кода функции означает изменение статуса текущего добавочного номера. Код функции по умолчанию * 94. По умолчанию он включен.",
  "call_features.feature_codes.office_time": "Изменить статус рабочего времени",
  "call_features.feature_codes.office_time_detail": "Если этот параметр включен, добавочные номера с таким разрешением могут набирать код функции для переключения телефонной системы в рабочее время или вне его. Код функции по умолчанию - * 99. Он включен по умолчанию. \n \nПримечание: добавочные номера также могут контролировать и переключать статус рабочего времени, настроив кнопку BLF на IP-телефоне. Значение ключа BLF - это код функции. После успешной подписки вы можете нажать кнопку BLF, чтобы напрямую переключить статус; индикатор BLF будет гореть зеленым в рабочие часы и красным в нерабочее время .",
  "call_features.feature_codes.office_time_permit_list": "Разрешение",
