  "call_features.feature_codes.paging_intercom_title": "Переговорное устройство",
  "call_features.feature_codes.parking": "Парковка вызова",
  "call_features.feature_codes.parking_detail": "Если этот параметр включен, добавочные номера могут набирать код функции, чтобы удерживать и парковать вызов по парковочному номеру, предоставленному системой. При успешной парковке инициатор парковки услышит номер парковки и может получить вызов с другого телефона, набрав номер парковки. Код функции по умолчанию - * 05. По умолчанию он включен. \nПримечание: если номер парковки недоступен, система предложит инициатору парковки вызова и возобновит вызов сразу после того, как подсказка закончится ».",
