  "call_features.feature_codes.park_timeout_detail": "Введите максимальную продолжительность парковки вызова (в секундах). По истечении времени ожидания вызов будет переведен в пункт назначения аварийного переключения. По умолчанию 60 секунд.",
  "call_features.feature_codes.pickup": "Перехват группового вызова",
  "call_features.feature_codes.pickup_detail": "Если этот параметр включен, добавочные номера в одной группе внутренних абонентов могут набирать код функции, чтобы ответить на звонок, поступающий от других членов группы. Код функции по умолчанию * 4. По умолчанию он включен. <br /> Примечание: если в группе внутренних линий одновременно поступает несколько звонков, будет принят первый звонок. Группа расширений здесь не включает группу по умолчанию системы: Default_All_Extensions.",
