  "call_features.feature_codes.queue_login_logout": "Вход / Выход",
  "call_features.feature_codes.queue_login_logout_detail": "Если этот параметр включен, динамические агенты могут набирать код функции + номер очереди для входа или выхода из очереди. Код функции по умолчанию * 7. Он включен по умолчанию. <br /> Расширения могут отслеживать состояние очереди агента, настраивая клавишу BLF на IP-телефоне. Значение ключа BLF - это код функции + номер добавочного номера + * + номер очереди (значение ключа BLF может быть кодом функции + номером очереди для отслеживания текущего добавочного номера). <br /> При успешной подписке индикатор BLF будет гореть красным для статуса выхода и зеленым для статуса входа.",
  "call_features.feature_codes.queue_pause_unpause": "Пауза / возобновление",
  "call_features.feature_codes.queue_pause_unpause_detail": "«Если этот параметр включен, операторы очереди могут набирать код функции + номер очереди, чтобы приостановить прием входящих вызовов из очереди и возобновить их. Код функции по умолчанию - * 07. По умолчанию он включен.\n\nПримечание: добавочные номера могут отслеживать состояние очереди агента, настроив кнопку BLF на IP-телефоне. Значение ключа BLF - это код функции + номер добавочного номера + * + номер очереди (значение ключа BLF может быть кодом функции + номером очереди для отслеживания текущего добавочного номера). При успешной подписке индикатор BLF будет гореть красным для состояния паузы и зеленым для состояния возобновления \".",
