  "extension_trunk.trunks.diversion_user_part": "Diversion",
  "extension_trunk.trunks.diversion_user_part_detail": "Определите значение в поле заголовка Diversion пакета SIP INVITE для исходящих вызовов из этой магистрали. Эта конфигурация требует профессиональных знаний протокола SIP, поскольку неправильная конфигурация может вызвать проблемы с вызовом. <br /> \n<br /> Параметры настройки внешней линии регистрации SIP: \n<br /> · [По умолчанию]: значение будет иметь следующий порядок приоритета: Исходящий маршрут Идентификатор исходящего вызывающего абонента → Идентификатор исходящего абонента внутреннего абонента → Идентификатор исходящего вызова по внешней линии → Имя пользователя на внешней линии → Идентификатор вызывающего абонента по внутренней линии → Идентификатор вызывающего абонента отправителя. \n<br /> · [Нет]: не отправлять этот параметр с пакетом SIP INVITE. \n<br /> · Outbound Route Outbound Caller ID: исходящий идентификатор вызывающего абонента, настроенный в <b> Управление вызовами> Исходящий маршрут </b>. \n<br /> · Extension Caller ID: исходящий идентификатор вызывающего абонента, связанный с внешней линией. \n<br /> · Trunk Outbound Caller ID: исходящий идентификатор вызывающего абонента, настроенный в <b> Extension / Trunk> Trunk> Outbound Caller ID> General </b>. \n<br /> · Имя пользователя внешней линии: имя пользователя внешней линии, настроенное в <b> Extension / Trunk> Trunk> Authentication </b> \n<br /> · Идентификатор вызывающего абонента внутреннего номера: идентификатор вызывающего абонента, настроенный в <b> Внутренний номер / внешняя линия> Внутренний номер> Пользователь> Информация о добавочном номере </b>, который по умолчанию совпадает с внутренним номером. \n<br /> · Идентификатор вызывающего абонента отправителя: номер идентификатора вызывающего абонента отправителя вызова (первый вызывающий абонент в случае перевода вызова). Если отправителем вызова является внешний номер, будет использован внешний номер. Если инициатором вызова является внутренний номер, порядок приоритета будет следующим: Идентификатор исходящего вызова внутреннего абонента → [По умолчанию]. \n<br /> · Пользовательский: укажите пользовательское значение. <br /> \n \n<br /> Параметры настройки магистрали однорангового узла SIP и магистрали учетной записи SIP: \n<br /> · [По умолчанию]: порядок приоритета будет следующим: Исходящий маршрут Идентификатор исходящего вызывающего абонента → Идентификатор исходящего абонента внутреннего абонента → Идентификатор исходящего вызова по внешней линии → Идентификатор вызывающего абонента внутреннего абонента → Идентификатор вызывающего абонента отправителя. \n<br /> · [Нет]: не отправлять этот параметр с пакетом SIP INVITE. \n<br /> · Outbound Route Outbound Caller ID: исходящий идентификатор вызывающего абонента, настроенный в <b> Управление вызовами> Исходящий маршрут </b>. \n<br /> · Extension Caller ID: исходящий идентификатор вызывающего абонента, связанный с внешней линией. \n<br /> · Trunk Outbound Caller ID: исходящий идентификатор вызывающего абонента, настроенный в <b> Extension / Trunk> Trunk> Outbound Caller ID> General </b>. \n<br /> · Идентификатор вызывающего абонента внутреннего абонента: идентификатор вызывающего абонента, настроенный в разделе <b> Внутренний номер / внешняя линия> Внутренний номер> Пользователь> Информация о добавочном номере </b>, который по умолчанию совпадает с внутренним номером. \n<br /> · Идентификатор вызывающего абонента отправителя: номер идентификатора вызывающего абонента отправителя вызова (первый вызывающий абонент в случае перевода вызова). Если отправителем вызова является внешний номер, будет использован внешний номер. Если инициатором вызова является внутренний номер, порядок приоритета будет следующим: Идентификатор исходящего вызова внутреннего абонента → [По умолчанию]. \n<br /> · Пользовательский: определение пользовательского значения. <br />",
