  "plan.callcenter_wallboard": "Real-time Wallboard",
  "plan.cc.answer": "Начните за считанные минуты с подробным {0}. Узнайте, как настроить их для агентов и администраторов очередей, а также установить разрешения на основе ролей для подробных операций.",
  "plan.cc.content": "Сложный набор функций центра обработки вызовов, который обеспечивает более быстрое разрешение вызовов и мониторинг, отчетность и управление центром обработки вызовов в реальном времени. Настраиваемая настенная панель для упреждающего отслеживания 16 ключевых показателей производительности, панель очереди коммутаторного типа для мониторинга и управления очередями в реальном времени, подробные отчеты центра обработки вызовов, SLA и многое другое.",
  "plan.cc.explain": "Ускорьте разрешение вызовов и мониторинг, отчетность и управление центром обработки вызовов в режиме реального времени с помощью расширенных функций центра обработки вызовов, в том числе настраиваемой настенной панели, панели очереди коммутаторного типа, расширенного SLA, диспетчера очереди и уведомления по электронной почте в реальном времени, а также 8 типов расширенного центра обработки вызовов отчеты.",
