  "plan.lcs": "{OEM.RemoteAccessServiceName}",
  "plan.lcs.answer": "Начать с。 {0}. Узнайте, как настроить специальное доменное имя для удаленного веб-доступа PBX и объединить свои глобальные команды за несколько минут!",
  "plan.lcs.answer.done": "2. Выберите {OEM.RemoteAccessServiceName} в настройках конфигурации сервера {OEM.LinkusName}, нажмите «Сохранить» и готово!",
  "plan.lcs.answer.path": "1. Выберите «Внутренний номер и магистраль»> «Расширение»> «Сервер {OEM.LinkusName}».",
  "plan.lcs.content": "Получите возможность работать из любого места и получить максимальную универсальную коммуникацию с помощью облачной службы, подключенной к вашему устройству {OEM.Series}. {OEM.RemoteAccessServiceName} делает полный спектр расширений и опций UC легкодоступным на {OEM.LinkusName} - независимо от местоположения - и освобождает вас от рискованной переадресации портов с помощью непрерывного и безопасного удаленного подключения {OEM.LinkusName}.",
  "plan.lcs.email": "Вы также можете отправить приветственное письмо {OEM.LinkusName} своим командам, чтобы быстро войти в свои клиенты {OEM.LinkusName}. См. Подробные сведения {0}.",
  "plan.lcs.explain": "Включите {OEM.RemoteAccessServiceName}, чтобы пользоваться бесперебойным и безопасным удаленным подключением {OEM.LinkusName}, и сразу же сделайте полный спектр возможностей расширения доступным для настольных и мобильных клиентов {OEM.LinkusName} в любом месте!",
  "plan.lcs.note": "<b>Note: </b>the PBX's {OEM.LinkusName} server is set up and connected automatically by the service now.",
  "plan.lcs.quality": "Лучшее качество звонков {OEM.LinkusName}",
  "plan.lcs.question": "Как подключить услугу?",
  "plan.lcs.setup": "Усилия по настройке сервера {OEM.LinkusName}",
  "plan.lcs.tunnel": "Частный и безопасный туннель",
  "plan.lcs.unuse": "{OEM.RemoteAccessServiceName} is a subscription-based service designed to set your team up for anywhere-anytime productivity, instantly and securely. It provides an easy-to-access domain name, safeguards PBX remote web access, and allows the remote workforce to enjoy consistent in-office unified communications experience with Linkus UC Clients anywhere, on any device.",
  "plan.lcs.unused": "{0} {OEM.RemoteAccessServiceName} {1} - это платная функция, включенная в план Enterprise. Разработанный для удаленной работы, он освобождает вас от рискованной переадресации портов, предлагает безопасные удаленные соединения и делает полный спектр функций расширений доступным для вашей команды на настольных и мобильных клиентах {OEM.LinkusName} в любом месте.",
  "plan.lcs.used": "Включенный в корпоративный план, {0} {OEM.RemoteAccessServiceName} {1} представляет собой дополнительную услугу для удаленной работы. Он освобождает вас от рискованной переадресации портов, предлагает безопасные удаленные соединения и делает полный спектр функций расширения доступным для вашей команды на настольных и мобильных клиентах {OEM.LinkusName} в любом месте.",
  "plan.lcs.used_fqdn": "Срок действия подписки истек. Служба удаленного доступа предназначена для мгновенной и безопасной настройки вашей команды в любом месте в любое время. Он обеспечивает простой в доступе доменное имя, гарантирует удаленный веб-доступ PBX, а также позволяет последовательно в офисе единый опыт связи с клиентами Linkus UC в любом месте, на любом устройстве.",
  "plan.lcs.used_fqdnno": "Срок действия подписки истек. Служба удаленного доступа предназначена для мгновенной и безопасной настройки вашей команды в любом месте в любое время. Он обеспечивает простой в доступе доменное имя, гарантирует удаленный веб-доступ PBX, а также позволяет последовательно в офисе единый опыт связи с клиентами Linkus UC в любом месте, на любом устройстве.\n\nЧтобы пользоваться услугой, пожалуйста, продлите подписку и навейте пользовательское доменное имя PBX (F'D) <b>в System > Network > Public IP и Ports.</b>",
  "plan.lcs.use_fqdn": "Служба удаленного доступа — это решение для удаленной работы под ключ на основе подписки. Она обеспечивает простое в доступе доменное имя, гарантирует удаленный веб-доступ PBX и позволяет удаленной рабочей силе пользоваться согласованным опытом общения с Linkus UC。 Клиенты в любом месте, на любом устройстве.",
  "plan.lcs.use_fqdnno": "Служба удаленного доступа — это удаленное рабочее решение под ключ на основе подписки, которое обеспечивает легкое в доступе доменное имя,\nгарантирует удаленный веб-доступ PBX и обеспечивает согласованный опыт общения с клиентами Linkus UC в любом месте, на любом устройстве.<br /><b>Важно:</b>пожалуйста, навейте пользовательские доменное имя PBX (F-DN) <b>в System > Network > IP и порты как можно</b> скорее. После настройки ваши команды смогут войти в веб-клиент Linkus PBX и портал управления PBX удаленно и безопасно с доменным именем.",
